«Россия 1» — это информационно-развлекательный телеканал, флагман ВГТРК.
Является лидером в производстве телевизионного контента и крупнейшим игроком отечественной киноиндустрии.
Среди контента телеканала:
— информационные программы;
— многосерийные телефильмы и сериалы;
— ток-шоу;
— конкурсы талантов;
— развлекательные и просветительские передачи;
— комедийные и игровые форматы;
— полнометражные художественные и документальные фильмы;
— трансляции значимых спортивных и общественно-политических событий;
— телемарафоны, акции, концерты и зрелищные мероприятия. Скрыть
